To change the background color of an adaptive card in Microsoft Teams, you can use the "containerStyle" property in the JSON schema of the adaptive card. However, it's important to note that Microsoft Teams currently does not support changing the background color of the entire adaptive card.

You can, however, change the background color of individual elements within the adaptive card, such as a container or column. Here's an example of how to change the background color of a container:
```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a background color"
                }
            ],
            "containerStyle": "good"
        }
    ],
    "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
    "version": "1.0"
}
```
In this example, the "containerStyle" property is set to "good", which will apply a green background color to the container. You can also use other predefined styles such as "attention", "warning", and "emphasis".

If you want to use a custom background color, you can use the "backgroundImage" property and set it to a base64 encoded image of a solid color. Here's an example:
```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a custom background color"
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ],
    "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
    "version": "1.0"
}
```
In this example, the "backgroundImage" property is set to a base64 encoded image of a solid color. You can generate a base64 encoded image of a solid color using an online tool such as [this one](https://www.base64-image.de/).

To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a Tooltip Provider:

Next, create a provider component that will wrap the tooltip components and provide the context to them. This provider will manage the state of the tooltip and provide a function to close the previously opened tooltip.

```jsx
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state and close the previously opened tooltip.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, content }) => {
  const { activeTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    closeTooltip();
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === content && (
        <div className="tooltip">{content}</div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the Tooltip Provider and Tooltip Component:

Finally, use the tooltip provider and tooltip component in your NextJS application.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip content="Tooltip 1">Hover me 1</Tooltip>
        <Tooltip content="Tooltip 2">Hover me 2</Tooltip>
        <Tooltip content="Tooltip 3">Hover me 3</Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

In this example, the `TooltipProvider` component wraps the `Tooltip` components and provides the context to them. The `Tooltip` component uses the context to manage its state and close the previously opened tooltip. When a user hovers over a tooltip, the `handleMouseEnter` function is called, which closes the previously opened tooltip. When the user moves the mouse away from the tooltip, the `handleMouseLeave` function is called, which also closes the tooltip.
